<html lang="es">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <title>Scanner</title>
  <style>
    body { font-family: system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", Arial; background:#0f172a; color:#e6eef8;
           display:flex; align-items:center; justify-content:center; height:100vh; margin:0; }
    .card { background:linear-gradient(180deg,#0b1220,#0f172a); padding:24px; border-radius:18px; width:92%; max-width:420px; box-shadow:0 8px 30px rgba(2,6,23,0.6); text-align:center; }
    h1 { margin:0 0 12px 0; font-size:20px; }
    p.lead { margin:6px 0 18px 0; color:#a8bfd6; }
    .bar-bg { background:#0b1330; border-radius:12px; height:18px; width:100%; overflow:hidden; }
    .bar-fill { background:linear-gradient(90deg,#10b981,#06b6d4); height:100%; width:0%; transition:width 0.4s ease; }
    .status { margin-top:14px; min-height:40px; }
    button { margin-top:14px; padding:10px 14px; border-radius:10px; border:none; background:#111827; color:#fff; font-weight:600; }
    .hidden { display:none; }
  </style>
</head>

    <div id="actions"></div>

<script>
(function(){
  const fill = document.getElementById('fill');
  const status = document.getElementById('status');
  const actions = document.getElementById('actions');
  const audio = document.getElementById('snd');

  let percent = 0;
  status.textContent = "";
  // Llenar la barra cada 1 segundo. Haremos 10 pasos (0-100 en 10s)
  const interval = setInterval(() => {
    percent += 10;
    fill.style.width = percent + '%';
    if (percent < 100) {
      status.textContent = 'Escaneando... ' + percent + '%';
    } else {
      clearInterval(interval);
      fill.style.width = '100%';
      status.innerHTML = '<strong>emos encontrado una aplicación con virus en su telefono</strong>';
      // Mostrar botón "eliminar virus"
      const btn = document.createElement('button');
      btn.textContent = 'eliminar virus';
      btn.onclick = onEliminarClick;
      actions.appendChild(btn);
    }
  }, 1000);

  function onEliminarClick() {
    // Cambiar mensaje
    status.innerHTML = '<strong>no emos podido eliminar el virus</strong>';
    // Reproducir audio y detenerlo a los 5 segundos
    // Aseguramos que la reproducción parte desde inicio
    audio.currentTime = 0;
    const playPromise = audio.play();
    if (playPromise !== undefined) {
      playPromise.catch(e => { /* reproducción bloqueada por navegador */ });
    }
    // Forzar pausa a los 5000ms
    setTimeout(() => {
      try { audio.pause(); audio.currentTime = 0; } catch(e){}
      // Intentar cerrar la ventana / app
      try { window.close(); } catch(e){}
      // Como fallback, redirigir a about:blank
      try { window.location.href = 'about:blank'; } catch(e){}
    }, 5000);
    // Deshabilitar el botón para que no se pulse otra vez
    const btn = actions.querySelector('button');
    if (btn) btn.disabled = true;
  }
})();
</script>
